    Reverse(s, temp); 

    // Har word ko revert karo 
    while (*temp) { 
        temp++; 
        if (*temp == '\0') { 
            Reverse(word_begin, temp - 1); 
        } else if (*temp == ' ') { 
            Reverse(word_begin, temp - 1); 
            word_begin = temp + 1; 
        } 
    } 
} 

// Driver code 
int main() 
{ 
    char s[] = "Welcome to Geeksforgeeks"; 
    char* temp = s; 
    ReverseWords(s); 
    printf("%s", s); 

    return 0; 
}"
